import {Fragment} from "react";
import cake from '../../Assets/cake.jpg';
import classes from './Header.module.css';

const Header=(props)=>{
    return(
        <Fragment>
        <header className={classes.header}>
        <h1>Bakery</h1>
        <button>Cart</button>
        </header>

        <div>
        <img src={cake} alt='it is a cake'/>   
        
        </div>

        </Fragment>
    );
}
export default Header
